INSERT INTO `credit_rating_scores` (`id`, `category`, `score_0_100`, `weight_percent`, `domain`, `raw_score`, `justification_for_achievement_score`, `contribution_percent`, `justification_for_strategic_weighting`) VALUES
(1, 'Business Profile', 60, 0.1, NULL, NULL, NULL, NULL, NULL),
(2, 'Financial Performance', 45, 0.1, NULL, NULL, NULL, NULL, NULL),
(3, 'Repayment Behavior', 40, 0.1, NULL, NULL, NULL, NULL, NULL),
(4, 'Operational Soundness', 40, 0.1, NULL, NULL, NULL, NULL, NULL),
(5, 'Management & Governance', 42, 0.1, NULL, NULL, NULL, NULL, NULL),
(6, 'Market & Customer Category', 43, 25, 'Market & Customer', 42.70, 'Market intent is strong and offtake validation (e.g., Woolworths) exists, but segmentation, GTM, and digital presence are not formalized.', 10.68, 'Central to Ikhwezis growth  buyers, branding, and sales traction drive investor interest and cash flow.'),
(7, 'Operational Category', 40, 25, 'Operational', 40.00, 'CVs and org structure exist, but no SOPs, documented workflows, or KPI review systems are in place. Operations are manually managed.', 10.00, 'Ikhwezis success depends on consistent production, rural sourcing, and internal team efficiency.'),
(8, 'Governance & Compliance Category', 42, 20, 'Governance & Compliance', 42.00, 'Legal registration and water license are confirmed. However, governance charter, board activity, risk register, and compliance policies are missing.', 8.40, 'Necessary for credibility, risk mitigation, and eligibility for public-private partnerships.'),
(9, 'Financial Category', 45, 15, 'Financial', 45.00, 'Cash flow forecasts and assumptions exist, but budget controls, multi-year forecasting tools, and variance tracking are weak.', 6.75, 'Supports planning and capital access but is not currently the main lever of Ikhwezis strategy.'),
(10, 'Technology Category', 21, 15, 'Technology', 20.90, 'No CRM, ERP, or cybersecurity evident. Technology environment is informal and non-integrated. Only basic infrastructure is noted.', 3.14, 'Technology will enable scaling and efficiency, but its currently underutilized and not prioritized.');
